        <div className='ui container comments'>           
         <CommentDetail author='Sam' timeAgo='Today at 4:45 pm'/>   
         <CommentDetail author='Alex' timeAgo='Today at 6:45 pm'/> 
         <CommentDetail author='Louic' timeAgo='Today at 8:45 pm'/> 
         <CommentDetail author='John' timeAgo='Today at 12:45 pm'/> 
        </div>

    );
};



            
ReactDOM.render(<App/>, document.querySelector('#root'));
